import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

function Pos() {
  const classes = useStyles();

  return (
    <div className="container" style={menu}>
      <div className={classes.root}>
        <Grid
          container
          spacing={3}
          direction="column"
          justify="flex-start"
          alignItems="stretch"
        >
          <Grid item xs={8} style={{ background: "blue" }}>
            <Paper className={classes.paper}>input</Paper>
          </Grid>
          <Grid item xs={4} style={{ height: "200px", background: "red" }}>
            <Paper className={classes.paper}>customer info</Paper>
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid item xs={8} style={{ background: "green" }}>
            <Paper className={classes.paper}>producsts</Paper>
          </Grid>
          <Grid item xs={4} style={{ background: "yellow" }}>
            <Paper className={classes.paper}>totals</Paper>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

const menu = {
  padding: "15px",
};

export default Pos;
